// App.js
import React from 'react';
import TransactionList from './TransactionList';
import TransactionForm from './TransactionForm';
import SearchBar from './SearchBar';

function App() {
  return (
    <div className="App">
      <h1>Bank of Flatiron</h1>
      <TransactionForm />
      <SearchBar />
      <TransactionList />
    </div>
  );
}

export default App;
